import React from 'react';

const Dashboard = () => {
  return (
    <div className="row w100">
      <header className="flex justify-content-between border-bottom line-h-5em">
        <h1>대시보드</h1>
      </header>
      <main>
        <p>여기에 대시보드 콘텐츠를 추가합니다.</p>
      </main>
    </div>
  );
};

export default Dashboard;
